import './App.css';
import Logo from './components/logo/Logo.js';
import Particles from 'react-particles-js'

const particlesOptions = {
  particles: {
    number : {
      value: 110,
      density: {
        enable: true,
        value_area: 800
      }
    }
  }
}


function App() {
  return (
    <div className="App">
      <header className='center'>
        <Logo />
      </header>
      <body>
        <div className="tarjetas">
          {/* <Block/>
          <Block/>
          <Block/>
          <Block/>
          <Block/>
          <Block/>
          <Block/> */}
        </div>
        {/* <DataBlock/> */}
        <Particles className='particles'
          params = {particlesOptions}
        />
      </body>

    </div>
  );
}

export default App;
